        "announce": "<p>\u041a\u043e\u043b\u043b\u0435\u0433\u0438 \u0441 22.11.2018 \u0432 \u043a\u0430\u0442\u0430\u043b\u043e\u0433 \u043a\u0443\u0440\u0441\u043e\u0432 \u0434\u043e\u0431\u0430\u0432\u043b\u0435\u043d \u043d\u043e\u0432\u044b\u0439 \u044d\u043b\u0435\u043a\u0442\u0440\u043e\u043d\u043d\u044b\u0439 \u043a\u0443\u0440\u0441 \"\u0418\u0441\u0442\u043e\u0440\u0438\u044f \u043e\u0442\u0434\u0435\u043b\u0430 \u041d\u0430\u0446\u0438\u043e\u043d\u0430\u043b\u044c\u043d\u044b\u0435 \u043a\u043b\u0438\u0435\u043d\u0442\u044b\".<\/p>",
        "message": "<p>\u0414\u0430\u043d\u043d\u044b\u0435 \u043a\u0443\u0440\u0441 \u043f\u043e\u0437\u043d\u0430\u043a\u043e\u043c\u0438\u0442 \u0412\u0430\u0441 \u0441 \u0431\u0430\u0437\u043e\u0432\u043e\u0439 \u0438\u043d\u0444\u043e\u0440\u043c\u0430\u0446\u0438\u0435\u0439 \u043e\u0431 \u043e\u0442\u0434\u0435\u043b\u0435 \u043f\u043e \u0440\u0430\u0431\u043e\u0442\u0435 \u0441 \u041d\u0430\u0446\u0438\u0430\u043b\u044c\u043d\u044b\u043c\u0438 \u043a\u043b\u0438\u0435\u043d\u0442\u0430\u043c\u0438: \u0446\u0435\u043b\u0438 \u043e\u0442\u0434\u0435\u043b\u0430, \u043a\u0440\u043e\u0441\u0441\u0444\u0443\u043d\u043a\u0446\u0438\u043e\u043d\u0430\u043b\u044c\u043d\u043e\u0435 \u0432\u0437\u0430\u0438\u043c\u043e\u0434\u0435\u0439\u0442\u0441\u0438\u0432\u0438\u0435, \u044d\u0444\u0444\u0435\u043a\u0442\u0438\u0432\u043d\u044b\u0435 \u0430\u043b\u0433\u043e\u0440\u0438\u0442\u043c\u044b \u0440\u0430\u0431\u043e\u0442\u044b \u0441 \u043a\u043b\u044e\u0447\u0435\u0432\u044b\u043c\u0438 \u043a\u043b\u0438\u0435\u043d\u0442\u0430\u043c\u0438. \u0417\u0430\u0445\u043e\u0434\u0438\u0442\u0435 \u0432 \u0440\u0430\u0437\u0434\u0435\u043b \"\u041e\u0431\u0443\u0447\u0435\u043d\u0438\u0435\/\u0440\u0430\u0437\u0432\u0438\u0442\u0438\u0435\", \u0432\u044b\u0431\u0438\u0440\u0430\u0439\u0442\u0435 \u043a\u0443\u0440\u0441 \u0438 \u043e\u0431\u043e\u0433\u0430\u0449\u0430\u0439\u0442\u0435 \u0441\u0435\u0431\u044f \u0438\u043d\u0444\u043e\u0440\u043c\u0430\u0446\u0438\u0435\u0439 \u0434\u043b\u044f \u0434\u043e\u0441\u0442\u0438\u0436\u0435\u043d\u0438 \u0441\u0432\u043e\u0438\u0445 \u0446\u0435\u043b\u0435\u0439 \u0432 \u0440\u0430\u0431\u043e\u0442\u0435.<\/p>",
